import React from 'react';
import {BrowserRouter,NavLink} from 'react-router-dom'



const Child = (props) => (

  <div className='modal'>
    <ul>
    {/*   {

        props.val.map(({temp, index}) => <li key={index}> 
            <BrowserRouter>
              <div>
                <NavLink to="/abc">temp</NavLink>
              </div>
            </BrowserRouter>
          </li>)
      } */}
      {
  console.log(typeof props.v)
  }
    </ul>
  </div>
)


class TestToBeGiven extends React.Component {

  state={
    flag: true,
    quiztopic:[
        {topic:"HTML" ,
        route:"/html"    },
        {topic:"CSS",
        route:"/css"},       
        {topic:"JAVASCRIPT",
        route:"/javascript"},
        {topic:"REACT",
        route:"/react"},
      ]
  }
  toggleHidden = () => {
    this.setState({
      flag: !this.state.flag
    })
    console.log("toggleHidden")
  }
  render() {
    const Topic = this.state.quiztopic;
    return (  
      <div>
        <BrowserRouter>
        <div>
          <NavLink to="/" onClick={this.toggleHidden}> JavaScript</NavLink> <br/>
          {!this.state.flag && <Child val={Topic}/>}
          <NavLink to="/"> react</NavLink>
          </div>
        </BrowserRouter>
      </div>
    );
  }
}



export default TestToBeGiven;
